import React, { useState } from 'react';
import { IconBellRinging, IconBuildingCommunity, IconUser } from '@tabler/icons-react';
import classes from '../../../styles/SettingsNavigation.module.css';

// Create components for each section of content
function OrganizationInfo() {
  return <div>Organization Info Content</div>;
}

function UniversityInfo() {
  return <div>University Info Content</div>;
}

function Notifications() {
  return <div>Notifications Content</div>;
}

export function SettingsNavigation() {
  const [active, setActive] = useState('Organization Info');

  // Define the components for each section
  const components = {
    'Organization Info': <OrganizationInfo />,
    'University Info': <UniversityInfo />,
    'Notifications': <Notifications />,
  };

  // Render the active component
  const activeComponent = components[active] || null;

  const links = data.map((item) => (
    <a
      className={classes.link}
      data-active={item.label === active || undefined}
      href={item.link}
      key={item.label}
      onClick={(event) => {
        event.preventDefault();
        setActive(item.label);
      }}
    >
      <item.icon className={classes.linkIcon} stroke={2} />
      <span>{item.label}</span>
    </a>
  ));

  return (
    <div className={classes.settingsContainer}>
      <div className={classes.navigation}>
        <nav className={classes.navbar}>
          {links}
        </nav>
      </div>

      <div className={classes.info}>
        {activeComponent}
      </div>
    </div>
  );
}
